フチ付きだからしっかりホールド<br><br>【製品特徴】<br>●オシャレなラインアートが特長のフチ付きすべり止めマットです。<br>●接着剤を一切使用していないので、べたついたりしません。<br>また、ホコリなどで吸着が弱くなっても水洗いすればご使用になれます。<br>●ダッシュボードやトレイなどに敷くだけの簡単取り付けで、車内の小物などのすべりを防ぎます。<br>●ソフト素材を使用しているので、ダッシュボードのような曲面にもフィットし、<br>携帯電話やリモコンなどを走行時の振動等から守ります。 <br><br>品名：WD-151 ノンスリップマット【ミッキー】 <br>製品寸法：H140×W180×D4mm<br>パッケージサイズ：H180×W200×D7mm <br>単品重量：100g<style type="text/css">
